import "./styles/submenus.css";
import { helpHttp } from "../helpers/helpHttp";
import { useEffect, useState } from "react";
const SubMenuCard = () => {
  const [categories, setCategories] = useState([]);
  const fetchData = () => {
    helpHttp()
      .get("http://127.0.0.1:8000/api/categories")
      .then((res) => setCategories(res));
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      <div className="container-sub-menus">
        <div className="section">
          <h1>Mis cartas</h1>
          <img
            className="icon-sub-menu"
            src="https://res.cloudinary.com/tolumaster/image/upload/v1668982258/media/PostImage/experiencia_dflrky.png"
            alt=""
          />
        </div>
        {categories.categories &&
          categories.categories.map((category, key) => {
            return (
              <div key={key} className="section">
                <h1 className="category-title">{category.name}</h1>
                <img className="icon-sub-menu" src={category.icon} alt="" />
              </div>
            );
          })}
      </div>
    </>
  );
};

export default SubMenuCard;
